'use strict'

const React = require('react')

const Component = require('./Component')

const PageHeader = require('./PageHeader')
const ToolbarFunctions = require('./ToolbarFunctions')
const ContentFunctions = require('./ContentFunctions')
const ToolbarInfo = require('./ToolbarInfo')
const ContentInfo = require('./ContentInfo')
const ToolbarSource = require('./ToolbarSource')
const ContentSource = require('./ContentSource')

const ui = require('../ui')
const profileReader = require('../profile-reader')

module.exports = class Page extends Component {
  constructor (props) {
    super(props)

    ui.state.on({
      zoom: this.handleZoom
    })

    this.state = {
      zoom: 'out'
    }

    ui.events.on('profile-loaded', profile => this.setState({profile}))
    ui.events.on('record-selected', record => this.setState({record}))
  }

  render () {
    const profile = this.state.profile
    const record = this.state.record
    return (
      <div id='main' className={`zoom-${this.state.zoom}`}
        onDragOver={this.handleDragOver} onDrop={this.handleDrop}
        >
        <PageHeader profile={profile} record={record} />

        <ToolbarFunctions profile={profile} record={record} />
        <ContentFunctions profile={profile} record={record} />

        <ToolbarInfo profile={profile} record={record} />
        <ContentInfo profile={profile} record={record} />

        <ToolbarSource profile={profile} record={record} />
        <ContentSource profile={profile} record={record} />
      </div>
    )
  }

  handleZoom (pane) {
    this.setState(prevState => {
      const newZoom = prevState.zoom !== 'out' ? 'out' : pane
      return {zoom: newZoom}
    })
  }

  handleDragOver (event) {
    event.preventDefault()
  }

  handleDrop (event) {
    event.stopPropagation()
    event.preventDefault()

    const dt = event.dataTransfer
    if (dt == null) return

    const file = dt.files[0]

    profileReader.load(file)
  }
}

'use strict'

const React = require('react')

const Component = require('./Component')

const thisPackage = require('../../../package.json')

module.exports = class PageHeader extends Component {
  constructor (props) {
    super(props)

    this.state = {}
  }

  handleDisplayPrivacy () {
    window.alert(PrivacyText)
  }

  render () {
    return (
      <div id='header'>
        <span>
          <span className='float-left'>
            moar profile viewer
            &nbsp;
            <i><span id='version'>v{thisPackage.version}</span></i>
            &nbsp;&nbsp;
            <span id='profile-name' />
          </span>
          <span className='float-right'>
            <a href='https://github.com/moar-things/moar-profile-viewer' target='github'>github</a>
            &nbsp;|&nbsp;
            <a href='#' onClick={this.handleDisplayPrivacy}>privacy</a>
            &nbsp;|&nbsp;
            <a href='help.html' target='help'>help</a>
          </span>
        </span>
      </div>
    )
  }
}

const PrivacyText = `
This application collects information with Google Analytics.

It collects pageviews for the primary page.  It also sends an event when attempts are made to load a profile, and when a profile is loaded successfully.  No data associated with the profile - name or data - is sent with those events, just that the attempt was made, and that the profile was loaded successfully.

That's it.  Enjoy.
`

'use strict'

const React = require('react')

const ZoomableComponent = require('./ZoomableComponent')

const ui = require('../ui')
const profileReader = require('../profile-reader')

module.exports = class ToolbarFunctions extends ZoomableComponent {
  constructor (props) {
    super(props)

    this.zoomPane = 't'
    this.state = {}

    this.state = ui.state.get({sort: 'total', show: 'user'})

    ui.state.on({
