exports.addIndents = addIndents

const Parts = require('./parts')

function addIndents (lines) {
  for (let line of lines) {
    addIndent(line)
  }
}

function addIndent (line) {
  for (let part of line.parts) {
    // looking for first text part
    if (!part.isText) continue

    // split into indent and rest
    const match = part.text.match(RegexIndent)
    const indent = match[1]
    const rest = match[2]

    // not indented, return
    if (indent === '') return

    // replace this part with wrapped indent and rest
    const newParts = []
    newParts.push(Parts.createTagStart('<span class="hljs-ext-indent">'))
    newParts.push(Parts.createText(indent))
    newParts.push(Parts.createTagEnd('</span>'))
    newParts.push(Parts.createText(rest))

    line.replacePart(part, newParts)

    // only handle the first part
    return
  }
}

const RegexIndent = /^(\s*)(.*)$/

'use strict'

// extend the result of highlight.js::highlight
// arguments:
//   - hljs - return value from hljs
// return value:
//  hljs object passed in as parameter
//  - value replaced with lines wrapped in <tr></tr>
//    - <td class="hljs-ext-lineno hljs-ext-lineno-{line number}">{line number}</td>
//    - <td class="hljs-ext-line">{html of highlighted source}</td>
//      - indentation in line wrapped in <span class="hljs-ext-indent">{indent}</span>
// expecting the hljs.value to:
// - have lines separated by \n and not <br>

exports.extend = extend

const TabExpansion = Array(5).join(' ') // tab -> 4 spaces, as the gods intended
// yeah gotta use Array(n+1).join(' ') to get a string of length n

const Lines = require('./lines')
const indenter = require('./indenter')
const respanner = require('./respanner')
const lineNumberer = require('./line-numberer')

function extend (hljs) {
  const value = hljs.value
  if (value == null) return

  let lines = value
    .split('\n')
    .map(line => line.replace('\t', TabExpansion)) // "expand tabs" heh
    .map(line => Lines.create(line))                // morph to Line objects

  // fix spans so they don't cross lines
  respanner.respan(lines)

  // add indents
  indenter.addIndents(lines)

  // add line numbers, converting to <tr>'s
  lineNumberer.addLineNumbers(lines)

  // reset hljs.value
  hljs.value = lines.map(line => line.string).join('\n')
}

'use strict'

exports.addLineNumbers = addLineNumbers

const Parts = require('./parts')

function addLineNumbers (lines) {
  let lineNumber = 0
  for (let line of lines) {
    lineNumber++

    // wrap existing line in a <td>
    line.appendPart(Parts.createTagEnd('</td>'))
    line.prependPart(Parts.createTagStart(`<td class="hljs-ext-line">`))

    // prepend the lineno <td> in front
    line.prependPart(Parts.createTagEnd('</td>'))
    line.prependPart(Parts.createText(`${lineNumber}`))
    line.prependPart(Parts.createTagStart(`<td class="hljs-ext-lineno hljs-ext-lineno-${lineNumber}">`))

    // wrap line in a <tr>
    line.prependPart(Parts.createTagStart('<tr>'))
    line.appendPart(Parts.createTagEnd('</tr>'))
  }
}

'use strict'

exports.create = create

const Parts = require('./parts')

// create a Line object from a line of hljs (line genned from highlight.js)
function create (hljsLine) {
  return new Line(hljsLine)
}

class Line {
  constructor (hljsLine) {
    this._parts = Parts.parseString(hljsLine)

    this._firstText = null
    this._lastText = null
    this._indent = null

    for (let part of this._parts) {
      if (!part.isText) continue
      if (this._firstText == null) {
        this._firstText = part
        if (part.text[0] === ' ') this._indent = part
      }
      this._lastText = part
    }
  }

  get firstText () { return this._firstText }
  get lastText () { return this._lastText }
  get indent () { return this._indent }
  get parts () { return this._parts }
  get string () { return this._parts.map(part => part.text).join('') }

  appendPart (part) {
    this._parts.push(part)
  }

  prependPart (part) {
    this._parts.unshift(part)
  }

  replacePart (part, parts) {
    const index = this._parts.indexOf(part)
    if (index === -1) return

    const args = [index, 1].concat(parts)
    this._parts.splice.apply(this._parts, args)
  }
}

'use strict'

exports.parseString = parseString
exports.createText = createText
exports.createTagStart = createTagStart
exports.createTagEnd = createTagEnd

function createText (text) { return new Part(text, TYPE_TEXT) }
function createTagStart (text) { return new Part(text, TYPE_TAG_START) }
function createTagEnd (text) { return new Part(text, TYPE_TAG_END) }

class Part {
  constructor (text, type) {
    this._text = text
    this._type = type
  }

  get text () { return this._text }
  get isText () { return this._type === TYPE_TEXT }
  get isTagStart () { return this._type === TYPE_TAG_START }
  get isTagEnd () { return this._type === TYPE_TAG_END }
}

function parseString (string) {
  let parts = []

  // iterate through line
  while (string !== '') {
    let part

    // split into text / <span ...> / </span>
    const match = string.match(RegexPart)
    if (match == null) {
      // this shouldn't happen, regexp is bad if so
      string = ''
      part = createText(string)
    } else {
      string = match[5]

      // convert what was matched to a part
      if (match[2] != null) part = createText(match[2])
      else if (match[3] != null) part = createTagEnd(match[3])
      else if (match[4] != null) part = createTagStart(match[4])
    }

    parts.push(part)
  }

  return parts
}

const TYPE_TEXT = 'text'
const TYPE_TAG_START = 'tagStart'
const TYPE_TAG_END = 'tagEnd'

const RegexPart = /^(([^<]+)|(<\/.*?>)|(<[^/].*?>))(.*)$/

'use strict'

exports.respan = respan

const Parts = require('./parts')

// given html from hljs, respan so that no span crosses lines
function respan (lines) {
  for (let i = 0; i < lines.length; i++) {
    const line = lines[i]

    // push tagStarts, pop tagEnds
    const spanStack = []
    for (let part of line.parts) {
      if (part.isTagStart) spanStack.push(part)
      if (part.isTagEnd) spanStack.pop()
    }

    // if no hanging spans, just continue
    if (spanStack.length === 0) continue

    // shouldn't happen, but just in case
    const nextLine = lines[i + 1]
    if (nextLine == null) continue

    // add span ends to current line
    spanStack.forEach(part => { line.appendPart(Parts.createTagEnd('</span>')) })

    // add span starts to next line
    spanStack.reverse()
    spanStack.forEach(part => { nextLine.prependPart(part) })
  }
}

